import { 
	CHANGE_SEARCHFIELD,
	REQUEST_ROBOTS_PENDING,
	REQUEST_ROBOTS_SUCCESS,
	REQUEST_ROBOTS_FAIL
} from './constants.js'

export const setSearchField = (text) => ({
	type: CHANGE_SEARCHFIELD,
	payload: text
})
